ultimaApresentacaoProposicao_descricao:
Apresentação do Requerimento n. 564/2014, pelo Deputado Onyx Lorenzoni (DEM-RS), que: "Requeiro que seja realiza audiência pública para discutir os transportes modal e ferroviário e de commodities no Brasil, convidando:
- Rumo Logística Operadora Multimodal S.A;
- Cosan S.A. Indústria e Comércio;
- Valec;
- Aprosoja;
- Alcopoa;
- Única".

descricao:
Em  decorrência da apreseciação dos destaques foi apresentado  Reformulação de Voto nos seguintes termos: 
-  Aprovados  o inciso III do art. 2º do Substitutitvo do SF; a estratégia 2.2. do Substitutivo do SF; a estratégia 3.3. do Substitutivo do SF, a estratégia 3.13 do Substitutivo do SF;  e a estratégia 7.36 do Substitutivo do SF; e 
-  Rejeitados o art. 4º do Substitutivo do SF, restabelecendo em seu lugar o art. 4º do Substitutivo da CD; e o  o texto da meta 19 do Substitutivo do SF, restabelecendo em seu lugar o texto da meta 19 do Substitutivo da CD;

Aprovado unanimemente o requerimento.
Subscreveu o requerimento o Deputado Roberto Britto.
Aprovado com alterações:
- Convidar um Técnico de Habitação da Caixa Econômica Federal no lugar do Vice-Presidente;
- Convidar representante da Secretaria do Idoso do DF no lugar da Secretaria de Justiça, Direitos Humanos e Cidadania do DF;
- Incluir na lista de convidados a CBIC - Câmara Brasileira da Indústria da Construção.
